import React, { useState } from "react";
import Navbar from "../base/navbar";
import Typing from "react-typing-animation";
import Fade from 'react-reveal/Fade';

export default function Login() {

    const [finishedTyping, setFinishedTyping] = useState(false);

    return (
        <div className="container mx-auto text-center px-30 text-white">
            <div className="flex flex-col sm:flex-row items-center justify-around h-screen">
                <div className="md:pr-64 flex-shrink-0 relative">
                    <Typing className="text-6xl font-cabin" speed={60} onFinishedTyping={() => setFinishedTyping(true)}>
                        <p>CONNECTE-TOI</p>
                        <p className="mt-7">AVEC TON COMPTE</p>
                        <h6 className="mt-7">BETASERIES<span className="text-purple-400">.</span></h6>
                    </Typing>
                    {finishedTyping && 
                    <Fade left>
                        <img className="hidden lg:block absolute inset-y-20 right-0 w-16 h-16" src="./assets/right-arrow.svg" />
                    </Fade>
                    }
                </div>
                <div className="flex">
                    <fieldset className="flex ml-10 py-20 px-32 border flex-col gap-y-10">
                        <legend>Login</legend>
                        <p className="flex-auto">mail</p>
                        <p className="flex-auto">mdp</p>
                        <p className="flex-auto">submit</p>
                    </fieldset>
                </div>
            </div>
        </div>
    );
}
